import React from 'react'
import CountUp from 'react-countup'
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>
      <CountUp end={200} />
      </h1>
      <h1>
      <CountUp end={200} duration={2} />
      </h1>
      <h1>
      <CountUp start={500} end={1000} duration={5} />
      </h1>
      <h1>
      <CountUp end={1000} duration={5} prefix />
      </h1>
    </div>
  );
}

export default App;
